import Axios from './caller.services'


let getAllstuff= ()=>{
	return Axios.get('/api/stuff')
}

let getStuff=(uid)=>{
	return Axios.get('/api/stuff/'+uid)
}

let modifyThing=(stuff)=>{
	return Axios.post('api/stuff',stuff)
}
export const stuffService = {
	getAllstuff,
	getStuff,
	modifyThing
}
